    require(msg.sender == getOwner(), "!OWNER");

    uint256 _supply = totalSupply();

    // Overflow-style checks preserved from original bytecode
    require(_buy == (_buy * _supply) / _supply || _supply == 0, "mul overflow");
    require(10000 != 0, "");           // mirrors `require(0x2710)`
    require(_sell == (_sell * _supply) / _supply || _supply == 0, "mul overflow");
    require(10000 != 0, "");
    require(_wallet == (_wallet * _supply) / _supply || _supply == 0, "mul overflow");
    require(10000 != 0, "");

    _maxTxAmount    = (_buy    * _supply) / 10000;
    _maxSellAmount  = (_sell   * _supply) / 10000;
    _maxWalletToken = (_wallet * _supply) / 10000;

    require(!((_supply - _maxTxAmount) > _supply), "sub overflow");
}

